-- The commands below were used in MySQL Worbench 8.0

-- Creating database
create database gestao_tarefas;

-- Setting database/schema as default
use gestao_tarefas;

-- Creating database tables
create table nivel_experiencia (
	cod_nivel_experiencia char(1) not null,
	descricao_nivel_experiencia varchar(10) not null,
    primary key (cod_nivel_experiencia)
);

create table programador (
	cod_programador int not null,
    nome varchar(80) not null,
    data_entrada_projeto date,
    cod_nivel_experiencia char(1) not null,
    primary key (cod_programador),
    foreign key (cod_nivel_experiencia) references nivel_experiencia (cod_nivel_experiencia)
);

create table escopo (
	cod_escopo int not null,
    descricao_escopo varchar(20) not null,
    primary key (cod_escopo)
);

create table prioridade (
	cod_prioridade int not null,
    descricao_prioridade varchar(20) not null,
    primary key (cod_prioridade)
);

create table produto (
	cod_produto int not null,
    nome_produto varchar(20) not null,
    primary key (cod_produto)
);

create table classificacao_modulo (
	cod_classificacao_modulo int not null,
    descricao_classificacao_modulo varchar(20) not null,
    primary key (cod_classificacao_modulo)
);

create table modulo (
	cod_modulo int not null,
    descricao_modulo varchar(20) not null,
    cod_classificacao_modulo int not null,
    primary key (cod_modulo),
    foreign key (cod_classificacao_modulo) references classificacao_modulo (cod_classificacao_modulo)
);

create table produto_modulo (
	cod_produto int not null,
    cod_modulo int not null,
    constraint pk_produto_modulo primary key (cod_produto, cod_modulo),
	foreign key (cod_produto) references produto (cod_produto),
    foreign key (cod_modulo) references modulo (cod_modulo)
);

create table sequencia_estimativa (
	cod_sequencia_estimativa int not null,
    descricao_sequencia_estimativa varchar(20) not null,
    primary key (cod_sequencia_estimativa)
);

create table valor_padrao_estimativa (
	valor float not null,
    unidade_medida varchar(10),
    constraint pk_valor_padrao_estimativa primary key (valor, unidade_medida)
);

create table valor_padrao_sequencia (
	valor float not null,
    unidade_medida varchar(10),
	cod_sequencia_estimativa int not null,
    constraint pk_valor_padrao_sequencia primary key (valor, unidade_medida, cod_sequencia_estimativa),
    constraint fk_valor_padrao foreign key (valor, unidade_medida) references valor_padrao_estimativa (valor, unidade_medida),
    constraint fk_sequencia_estimativa foreign key (cod_sequencia_estimativa) references sequencia_estimativa (cod_sequencia_estimativa)
);

create table sprint (
	quinzena int not null,
    mes int not null,
    ano int not null,
    constraint pk_sprint primary key (quinzena, mes, ano)
);

create table tarefa (
	cod_tarefa int not null,
    titulo varchar(150) not null,
    tempo_estimado float not null,
    tempo_gasto float not null,
    unidade_medida varchar(10),
    cod_sequencia_estimativa int not null,
	quantidade_falhas int not null,
    cod_programador int not null,
    cod_escopo int not null,
    cod_prioridade int not null,
	cod_produto int not null,
    cod_modulo int not null,
    quinzena int not null,
    mes int not null,
    ano int not null,    
    primary key (cod_tarefa),
    foreign key (cod_programador) references programador (cod_programador),
    foreign key (cod_escopo) references escopo (cod_escopo),
    foreign key (cod_prioridade) references prioridade (cod_prioridade),
    constraint fk_produto_modulo foreign key (cod_produto, cod_modulo) references produto_modulo (cod_produto, cod_modulo),
    constraint fk_estimativa_tarefa foreign key (tempo_estimado, unidade_medida, cod_sequencia_estimativa) references valor_padrao_sequencia (valor, unidade_medida, cod_sequencia_estimativa),
    constraint fk_sprint_tarefa foreign key (quinzena, mes, ano) references sprint (quinzena, mes, ano)
);

